	public int GetStrokeIndex(StrokeExtended stroke) {
		int strokeIdx = 0;
		NormStroke normStroke = new NormStroke(stroke, 0);
		
		double tempScore;
		double maxScore = Double.MIN_VALUE;
				
		double[] scores = new double[ListNormStrokes.size()];
		
		UtilsShapeComparer shapeComparer = new UtilsShapeComparer();
		for(int idx = 0; idx < ListNormStrokes.size(); idx++) {
			shapeComparer.Compare(normStroke, ListNormStrokes.get(idx));
						
			tempScore = shapeComparer.MinCosineDistance;
			scores[idx] = tempScore;
			
			if(tempScore > maxScore) {
				maxScore = tempScore;
				strokeIdx = idx;
			}
		}
		
		return strokeIdx;
	}
	
